import React, { Component } from 'react'
import $ from "jquery";
import { useParams } from "react-router-dom";

export default class Pages extends Component {
    constructor(props) {
        super(props);
        this.state = {
            image: "../images/de.jpg",
            isLoaded: false,
            items: []
        }
    }

    render() {
        let {id} = useParams();
        console.log(id);
        return (
            <div>
                <img src='../images/de.jpg'></img>
                <div>{this.state.items}</div>
            </div>
        )
    }
}
